import React, { Component } from 'react'
import {
  Box,
  Image,
  Text,
  Link,
  useColorMode,
  Button,
  Flex
} from '@chakra-ui/core'

import {HStack, VStack, Circle } from '@chakra-ui/react'

type AttributesProps = {
  attributes: any[],
  colorMode: string,
}

export class Attributes extends Component<AttributesProps> {
  render() {
    let colorMode = this.props.colorMode
    let attributes = this.props.attributes
    return (
      // <Flex w="100%" justify="center" >

            <HStack justify="center" key={0} w="300px" >
              {
                attributes.map(attribute=>{
                  return (
                    <Box d="flex"width="100%" backgroundColor={colorMode == "light"? "gray.100": "gray.700"} alignItems="baseline" className="coin-balance-content">
                      <Box color="gray.500" textAlign="center" fontSize="sm" >
                        <Text className="view-nft-link" color={this.props.colorMode=="dark" ? "navajowhite": "gray"} >{attribute.trait_type}</Text>
                      </Box>
                    </Box>
                  )
                })
              }
            </HStack>

      // </Flex>
    )
  }
}

export default Attributes
